// src/pages/TodosPage.jsx
import React from 'react';

const TodosPage = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>My Tasks</h1>
      <p>Manage your to-do items</p>
    </div>
  );
};

export default TodosPage;
